webpackJsonp([0xdd60ac930659],{8733:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"DDR Show",date:"25 Sep 2003",slug:"/2003-09-25-ddr-show/",tags:"Y2003"},html:"<p>We accidentally tuned in to the <a title=\"RTL.de\" href=\"http://www.rtl.de/musik/musik_819362.html\">DDR Show</a> (with a mostly silent Kati Witt and, um, some blond guy) last night (ZDF was running soccer, so Heute Journal was running late). Now I can answer the question of whether 'Ostalgie' shows trivialize the brutal dictatorship of the DDR with an unqualified 'yes'.</p>\n<p>They did have ex-FM Genscher together with a couple who were among the several thousand who had camped out at the West German embassy in Prague back in 1989 and were allowed to emigrate. The couple thanked Genscher for his actions back then. Shouldn't it have been the other way around?</p>"},next:{fields:{title:"What Works?",date:"24 Sep 2003",slug:"/2003-09-24-what-works/"}},previous:{fields:{title:"German Court Accepts Teacher's Head Scarf",date:"25 Sep 2003",slug:"/2003-09-25-german-court-accepts-teachers-head-scarf/"}}},{node:{fields:{title:"What Works?",date:"24 Sep 2003",slug:"/2003-09-24-what-works/",tags:"Y2003"},html:'<p>I got this mail from work after I left yesterday, regarding a PC I care for: "I put dathon on your desk. CPU and graphic card were defective, and as I tried to boot it, there were also disk errors! Maybe you can still save something... we do have spare disks."</p>\n<p>Does anything in the machine still work? Anything? Looks like it will be a fun morning...</p>'},next:{fields:{title:"Twins win 10th in a row",date:"24 Sep 2003",slug:"/2003-09-24-twins-win-10th-in-a-row/"}},previous:{fields:{title:"DDR Show",date:"25 Sep 2003",slug:"/2003-09-25-ddr-show/"}}},{node:{fields:{title:"Twins win 10th in a row",date:"24 Sep 2003",slug:"/2003-09-24-twins-win-10th-in-a-row/",tags:"Y2003"},html:'<p><a title="KC and Chi both lost big" href="http://sports.yahoo.com/mlb/recap?gid=230923109">Twins win 10th in a row, clinch AL Central!</a></p>'},next:{fields:{title:"First Post",date:"24 Sep 2003",slug:"/2003-09-24-first-post/"}},previous:{fields:{title:"What Works?",date:"24 Sep 2003",slug:"/2003-09-24-what-works/"}}}],pathPrefix:"",first:!1,last:!1,index:623,pageCount:1101}}}});
